import data from './data';

function App() {
  return (
    <div>
      <header>
        <a href="/">Hava Weeds Dealer</a>
      </header>
      <main>
        <h1>Our Services</h1>
        {data.services.map((service) => (
          <div key={service.slug}>
            <img src={service.image} alt={service.name} />
            <p>{service.name}</p>
          </div>
        ))}
      </main>
    </div>
  );
}

export default App;
